(847, '5371E4E2FF8C4f6bA721395F618A3ACC', 'English', 'English', 'Compare and contrast the experience of reading a story, drama, or poem to listening to or viewing an audio, video, or live version of the text, including contrasting what they &quot;see&quot; and &quot;hear&quot; when reading the text to what they perceive when they listen or watch.', 7, 'a:1:{i:0;s:2:"06";}', 'Common Core State Standards Initiative', 'CCSS', '', 'CCSS.ELA-Literacy.RL.6.7', 'RL.6.7', 'a:9:{s:2:"id";s:8:"S1143795";s:4:"leaf";s:4:"true";s:3:"cls";N;s:15:"authorityStatus";s:18:"Original Statement";s:14:"indexingStatus";s:3:"Yes";s:17:"statementNotation";s:6:"RL.6.7";s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143795";s:8:"children";N;s:6:"parent";s:8:"S11436B0";}', 'a:4:{s:3:"URI";s:44:"http://corestandards.org/ELA-Literacy/RL/6/7";s:13:"dotNotationV1";s:15:"Literacy.RL.6.7";s:11:"dotNotation";s:24:"CCSS.ELA-Literacy.RL.6.7";s:10:"currentURL";s:114:"http://www.corestandards.org/the-standards/english-language-arts-standards/reading-literature-6-12/grade-6/#rl-6-7";}'),
