(1082, '761A3E5758B74fda87EF31BBFB156CFF', 'English', 'English', 'Translate quantitative or technical information expressed in words in a text into visual form (e.g., a table or chart) and translate information expressed visually or mathematically (e.g., in an equation) into words.', 7, 'a:2:{i:0;s:2:"09";i:1;s:2:"10";}', 'Common Core State Standards Initiative', 'CCSS', 'Grades 9-1', 'CCSS.ELA-Literacy.RST.9-1', 'RST.9-10.7', 'a:9:{s:2:"id";s:8:"S1143AD7";s:4:"leaf";s:4:"true";s:3:"cls";N;s:15:"authorityStatus";s:18:"Original Statement";s:14:"indexingStatus";s:3:"Yes";s:17:"statementNotation";s:10:"RST.9-10.7";s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143AD7";s:8:"children";N;s:6:"parent";s:8:"S1143AC0";}', 'a:4:{s:3:"URI";s:48:"http://corestandards.org/ELA-Literacy/RST/9-10/7";s:13:"dotNotationV1";s:19:"Literacy.RST.9-10.7";s:11:"dotNotation";s:28:"CCSS.ELA-Literacy.RST.9-10.7";s:10:"currentURL";s:116:"http://www.corestandards.org/the-standards/english-language-arts-standards/science-technical/grades-9-10/#rst-9-10-7";}'),
(1083, 'AC37239B265849e9BA55970D29D7F4B9', 'English', 'English', 'Compare and contrast findings presented in a text to those from other sources (including their own experiments), noting when the findings support or contradict previous explanations or accounts.', 9, 'a:2:{i:0;s:2:"09";i:1;s:2:"10";}', 'Common Core State Standards Initiative', 'CCSS', 'Grades 9-1', 'CCSS.ELA-Literacy.RST.9-1', 'RST.9-10.9', 'a:9:{s:2:"id";s:8:"S1143AD9";s:4:"leaf";s:4:"true";s:3:"cls";N;s:15:"authorityStatus";s:18:"Original Statement";s:14:"indexingStatus";s:3:"Yes";s:17:"statementNotation";s:10:"RST.9-10.9";s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143AD9";s:8:"children";N;s:6:"parent";s:8:"S1143AC0";}', 'a:4:{s:3:"URI";s:48:"http://corestandards.org/ELA-Literacy/RST/9-10/9";s:13:"dotNotationV1";s:19:"Literacy.RST.9-10.9";s:11:"dotNotation";s:28:"CCSS.ELA-Literacy.RST.9-10.9";s:10:"currentURL";s:116:"http://www.corestandards.org/the-standards/english-language-arts-standards/science-technical/grades-9-10/#rst-9-10-9";}'),
(1084, '7E2757E59AC24f83A8491D31D6462DA7', 'English', 'English', 'Integrate and evaluate multiple sources of information presented in diverse formats and media (e.g., quantitative data, video, multimedia) in order to address a question or solve a problem.', 7, 'a:2:{i:0;s:2:"11";i:1;s:2:"12";}', 'Common Core State Standards Initiative', 'CCSS', 'Grades 11-', 'CCSS.ELA-Literacy.RST.11-', 'RST.11-12.7', 'a:9:{s:2:"id";s:8:"S1143ADA";s:4:"leaf";s:4:"true";s:3:"cls";N;s:15:"authorityStatus";s:18:"Original Statement";s:14:"indexingStatus";s:3:"Yes";s:17:"statementNotation";s:11:"RST.11-12.7";s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143ADA";s:8:"children";N;s:6:"parent";s:8:"S1143AC0";}', 'a:4:{s:3:"URI";s:49:"http://corestandards.org/ELA-Literacy/RST/11-12/7";s:13:"dotNotationV1";s:20:"Literacy.RST.11-12.7";s:11:"dotNotation";s:29:"CCSS.ELA-Literacy.RST.11-12.7";s:10:"currentURL";s:118:"http://www.corestandards.org/the-standards/english-language-arts-standards/science-technical/grades-11-12/#rst-11-12-7";}'),
