(1250, 'B4A824ED0CB6405bB9858FD557867737', 'English', 'English', 'Engage and orient the reader by setting out a problem, situation, or observation and its significance, establishing one or multiple point(s) of view, and introducing a narrator and/or characters; create a smooth progression of experiences or events.', 0, 'a:2:{i:0;s:2:"11";i:1;s:2:"12";}', 'Common Core State Standards Initiative', 'CCSS', 'Grades 11-', 'CCSS.ELA-Literacy.W.11-12', 'W.11-12.3a', 'a:9:{s:2:"id";s:8:"S11439A4";s:4:"leaf";s:4:"true";s:3:"cls";N;s:15:"authorityStatus";s:18:"Original Statement";s:14:"indexingStatus";s:3:"Yes";s:17:"statementNotation";s:11:"W.11-12.3.a";s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11439A4";s:8:"children";N;s:6:"parent";s:8:"S2364883";}', 'a:4:{s:3:"URI";s:48:"http://corestandards.org/ELA-Literacy/W/11-12/3a";s:13:"dotNotationV1";s:19:"Literacy.W.11-12.3a";s:11:"dotNotation";s:28:"CCSS.ELA-Literacy.W.11-12.3a";s:10:"currentURL";N;}'),
