(1457, 'C35D6312012244c7A8045E06A99C1977', 'English', 'English', 'Respond thoughtfully to diverse perspectives, summarize points of agreement and disagreement, and, when warranted, qualify or justify their own views and understanding and make new connections in light of the evidence and reasoning presented.', 0, 'a:2:{i:0;s:2:"09";i:1;s:2:"10";}', 'Common Core State Standards Initiative', 'CCSS', 'Grades 9-1', 'CCSS.ELA-Literacy.SL.9-10', 'SL.9-10.1d', 'a:9:{s:2:"id";s:8:"S1143931";s:4:"leaf";s:4:"true";s:3:"cls";N;s:15:"authorityStatus";s:18:"Original Statement";s:14:"indexingStatus";s:3:"Yes";s:17:"statementNotation";s:11:"SL.9-10.1.d";s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143931";s:8:"children";N;s:6:"parent";s:8:"S1143918";}', 'a:4:{s:3:"URI";s:48:"http://corestandards.org/ELA-Literacy/SL/9-10/1d";s:13:"dotNotationV1";s:19:"Literacy.SL.9-10.1d";s:11:"dotNotation";s:28:"CCSS.ELA-Literacy.SL.9-10.1d";s:10:"currentURL";N;}'),
