(1461, 'C0B2E6282CB442ddA731CE58EBB21CE6', 'English', 'English', 'Propel conversations by posing and responding to questions that probe reasoning and evidence; ensure a hearing for a full range of positions on a topic or issue; clarify, verify, or challenge ideas and conclusions; and promote divergent and creative perspectives.', 0, 'a:2:{i:0;s:2:"11";i:1;s:2:"12";}', 'Common Core State Standards Initiative', 'CCSS', 'Grades 11-', 'CCSS.ELA-Literacy.SL.11-1', 'SL.11-12.1c', 'a:9:{s:2:"id";s:8:"S1143934";s:4:"leaf";s:4:"true";s:3:"cls";N;s:15:"authorityStatus";s:18:"Original Statement";s:14:"indexingStatus";s:3:"Yes";s:17:"statementNotation";s:12:"SL.11-12.1.c";s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143934";s:8:"children";N;s:6:"parent";s:8:"S114391B";}', 'a:4:{s:3:"URI";s:49:"http://corestandards.org/ELA-Literacy/SL/11-12/1c";s:13:"dotNotationV1";s:20:"Literacy.SL.11-12.1c";s:11:"dotNotation";s:29:"CCSS.ELA-Literacy.SL.11-12.1c";s:10:"currentURL";N;}'),
(1462, '6ACFA2D011AB45e6943FC3B90DADFBB9', 'English', 'English', 'Respond thoughtfully to diverse perspectives; synthesize comments, claims, and evidence made on all sides of an issue; resolve contradictions when possible; and determine what additional information or research is required to deepen the investigation or complete the task.', 0, 'a:2:{i:0;s:2:"11";i:1;s:2:"12";}', 'Common Core State Standards Initiative', 'CCSS', 'Grades 11-', 'CCSS.ELA-Literacy.SL.11-1', 'SL.11-12.1d', 'a:9:{s:2:"id";s:8:"S1143935";s:4:"leaf";s:4:"true";s:3:"cls";N;s:15:"authorityStatus";s:18:"Original Statement";s:14:"indexingStatus";s:3:"Yes";s:17:"statementNotation";s:12:"SL.11-12.1.d";s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143935";s:8:"children";N;s:6:"parent";s:8:"S114391B";}', 'a:4:{s:3:"URI";s:49:"http://corestandards.org/ELA-Literacy/SL/11-12/1d";s:13:"dotNotationV1";s:20:"Literacy.SL.11-12.1d";s:11:"dotNotation";s:29:"CCSS.ELA-Literacy.SL.11-12.1d";s:10:"currentURL";N;}'),
