(42, '6C33D2BEC1AC431C8FC4BF9FD4DD3DCA', 'Math', 'English', 'Add and subtract within 20, demonstrating fluency for addition and subtraction within 10. Use strategies such as counting on; making ten (e.g., 8 + 6 = 8 + 2 + 4 = 10 + 4 = 14); decomposing a number leading to a ten (e.g., 13 â€” 4 = 13 â€” 3 â€” 1 = 10 â€” 1 = 9); using the relationship between addition and subtraction (e.g., knowing that 8 + 4 = 12, one knows 12 â€” 8 = 4); and creating equivalent but easier or known sums (e.g., adding 6 + 7 by creating the known equivalent 6 + 6 + 1 = 12 + 1 = 13).', 6, 'a:1:{i:0;s:2:"01";}', 'Common Core State Standards Initiative', 'CC', 'Grade 1', 'Math.1.OA.6', '1.OA.6', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114343D";s:2:"id";s:8:"S114343D";s:6:"parent";s:8:"S114342F";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"1.OA.6";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"6C33D2BEC1AC431C8FC4BF9FD4DD3DCA";s:11:"dotNotation";s:11:"Math.1.OA.6";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/1/OA/6";s:10:"currentURL";s:104:"http://www.corestandards.org/the-standards/mathematics/grade-1/operations-and-algebraic-thinking/#1-oa-6";}'),
