(57, 'E7A132DB485E49D2905C50BA78C571F5', 'Math', 'English', 'Understand division as an unknown-factor problem.', 6, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.OA.6', '3.OA.6', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114347C";s:2:"id";s:8:"S114347C";s:6:"parent";s:8:"S114346E";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"3.OA.6";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"E7A132DB485E49D2905C50BA78C571F5";s:11:"dotNotation";s:11:"Math.3.OA.6";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/3/OA/6";s:10:"currentURL";s:100:"http://corestandards.org/the-standards/mathematics/grade-3/operations-and-algebraic-thinking/#3-oa-6";}'),
(58, 'FD7A8A1461E048A1BB220ABA40139E3E', 'Math', 'English', 'Multiply and divide within 100.', 0, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.OA.C', '3.OA.C', 'N;', 'a:4:{s:4:"GUID";s:32:"FD7A8A1461E048A1BB220ABA40139E3E";s:11:"dotNotation";s:11:"Math.3.OA.C";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/3/OA/C";s:10:"currentURL";N;}'),
(59, '3D384CB2349B41299A3B5A133AB9E3F8', 'Math', 'English', 'Fluently multiply and divide within 100, using strategies such as the relationship between multiplication and division (e.g., knowing that 8 Ã— 5 = 40, one knows 40 Ã· 5 = 8) or properties of operations. By the end of Grade 3, know from memory all products of two one-digit numbers.', 7, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.OA.7', '3.OA.7', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114347D";s:2:"id";s:8:"S114347D";s:6:"parent";s:8:"S114346F";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"3.OA.7";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"3D384CB2349B41299A3B5A133AB9E3F8";s:11:"dotNotation";s:11:"Math.3.OA.7";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/3/OA/7";s:10:"currentURL";s:100:"http://corestandards.org/the-standards/mathematics/grade-3/operations-and-algebraic-thinking/#3-oa-7";}'),
(60, 'D99E14C6EA514E36A82F63FC3EEA56A0', 'Math', 'English', 'Solve problems involving the four operations, and identify and explain patterns in arithmetic.', 0, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.OA.D', '3.OA.D', 'N;', 'a:4:{s:4:"GUID";s:32:"D99E14C6EA514E36A82F63FC3EEA56A0";s:11:"dotNotation";s:11:"Math.3.OA.D";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/3/OA/D";s:10:"currentURL";N;}'),
(61, '3D384CB2349B41299A3B5A133AB9E3F9', 'Math', 'English', 'Solve two-step word problems using the four operations. Represent these problems using equations with a letter standing for the unknown quantity. Assess the reasonableness of answers using mental computation and estimation strategies including rounding.', 8, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.OA.8', '3.OA.8', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114347E";s:2:"id";s:8:"S114347E";s:6:"parent";s:8:"S1143470";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"3.OA.8";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"3D384CB2349B41299A3B5A133AB9E3F9";s:11:"dotNotation";s:11:"Math.3.OA.8";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/3/OA/8";s:10:"currentURL";s:100:"http://corestandards.org/the-standards/mathematics/grade-3/operations-and-algebraic-thinking/#3-oa-8";}'),
(62, 'C220B1257A75437196AEBEC0B0C4B4BC', 'Math', 'English', 'Identify arithmetic patterns (including patterns in the addition table or multiplication table), and explain them using properties of operations.', 9, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.OA.9', '3.OA.9', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114347F";s:2:"id";s:8:"S114347F";s:6:"parent";s:8:"S1143470";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"3.OA.9";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"C220B1257A75437196AEBEC0B0C4B4BC";s:11:"dotNotation";s:11:"Math.3.OA.9";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/3/OA/9";s:10:"currentURL";s:100:"http://corestandards.org/the-standards/mathematics/grade-3/operations-and-algebraic-thinking/#3-oa-9";}'),
(63, 'C23D0AFF59694FACA65ECEEBDE3F1698', 'Math', 'English', 'Use the four operations with whole numbers to solve problems.', 0, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.OA.A', '4.OA.A', 'N;', 'a:4:{s:4:"GUID";s:32:"C23D0AFF59694FACA65ECEEBDE3F1698";s:11:"dotNotation";s:11:"Math.4.OA.A";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/OA/A";s:10:"currentURL";N;}'),
(64, '7828B4F15ABD40E19EF14DDE0EB399DF', 'Math', 'English', 'Interpret a multiplication equation as a comparison, e.g., interpret 35 = 5 Ã— 7 as a statement that 35 is 5 times as many as 7 and 7 times as many as 5. Represent verbal statements of multiplicative comparisons as multiplication equations.', 1, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.OA.1', '4.OA.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114349A";s:2:"id";s:8:"S114349A";s:6:"parent";s:8:"S1143490";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"4.OA.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"7828B4F15ABD40E19EF14DDE0EB399DF";s:11:"dotNotation";s:11:"Math.4.OA.1";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/OA/1";s:10:"currentURL";s:104:"http://www.corestandards.org/the-standards/mathematics/grade-4/operations-and-algebraic-thinking/#4-oa-1";}'),
(65, '062925BDC19347E8890A6D7390DF3842', 'Math', 'English', 'Multiply or divide to solve word problems involving multiplicative comparison, e.g., by using drawings and equations with a symbol for the unknown number to represent the problem, distinguishing multiplicative comparison from additive comparison.', 2, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.OA.2', '4.OA.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114349B";s:2:"id";s:8:"S114349B";s:6:"parent";s:8:"S1143490";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"4.OA.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"062925BDC19347E8890A6D7390DF3842";s:11:"dotNotation";s:11:"Math.4.OA.2";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/OA/2";s:10:"currentURL";s:104:"http://www.corestandards.org/the-standards/mathematics/grade-4/operations-and-algebraic-thinking/#4-oa-2";}'),
(66, 'D3852439BE5747BA9E52B55237414DBC', 'Math', 'English', 'Solve multistep word problems posed with whole numbers and having whole-number answers using the four operations, including problems in which remainders must be interpreted. Represent these problems using equations with a letter standing for the unknown quantity. Assess the reasonableness of answers using mental computation and estimation strategies including rounding.', 3, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.OA.3', '4.OA.3', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114349C";s:2:"id";s:8:"S114349C";s:6:"parent";s:8:"S1143490";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"4.OA.3";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"D3852439BE5747BA9E52B55237414DBC";s:11:"dotNotation";s:11:"Math.4.OA.3";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/OA/3";s:10:"currentURL";s:104:"http://www.corestandards.org/the-standards/mathematics/grade-4/operations-and-algebraic-thinking/#4-oa-3";}'),
(67, '1FAE8D11BF744C22A5FC37D6A49587C5', 'Math', 'English', 'Gain familiarity with factors and multiples.', 0, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.OA.B', '4.OA.B', 'N;', 'a:4:{s:4:"GUID";s:32:"1FAE8D11BF744C22A5FC37D6A49587C5";s:11:"dotNotation";s:11:"Math.4.OA.B";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/OA/B";s:10:"currentURL";N;}');
