(68, '426D6BDB2D4A4C6D86DEDD3469B03F52', 'Math', 'English', 'Find all factor pairs for a whole number in the range 1â€”100. Recognize that a whole number is a multiple of each of its factors. Determine whether a given whole number in the range 1â€”100 is a multiple of a given one-digit number. Determine whether a given whole number in the range 1â€”100 is prime or composite.', 4, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.OA.4', '4.OA.4', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114349D";s:2:"id";s:8:"S114349D";s:6:"parent";s:8:"S1143491";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"4.OA.4";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"426D6BDB2D4A4C6D86DEDD3469B03F52";s:11:"dotNotation";s:11:"Math.4.OA.4";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/OA/4";s:10:"currentURL";s:104:"http://www.corestandards.org/the-standards/mathematics/grade-4/operations-and-algebraic-thinking/#4-oa-4";}'),
