(165, 'E257C49DFC7347BBA95E3DC0A278856D', 'Math', 'English', 'Tell and write time to the nearest minute and measure time intervals in minutes. Solve word problems involving addition and subtraction of time intervals in minutes, e.g., by representing the problem on a number line diagram.', 1, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.MD.1', '3.MD.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143486";s:2:"id";s:8:"S1143486";s:6:"parent";s:8:"S1143474";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"3.MD.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"E257C49DFC7347BBA95E3DC0A278856D";s:11:"dotNotation";s:11:"Math.3.MD.1";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/3/MD/1";s:10:"currentURL";s:91:"http://www.corestandards.org/the-standards/mathematics/grade-3/measurement-and-data/#3-md-1";}'),
(166, '3311256F77B14AF1A5798771E036BFE6', 'Math', 'English', 'Measure and estimate liquid volumes and masses of objects using standard units of grams (g), kilograms (kg), and liters (l). Add, subtract, multiply, or divide to solve one-step word problems involving masses or volumes that are given in the same units, e.g., by using drawings (such as a beaker with a measurement scale) to represent the problem.', 2, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.MD.2', '3.MD.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143487";s:2:"id";s:8:"S1143487";s:6:"parent";s:8:"S1143474";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"3.MD.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"3311256F77B14AF1A5798771E036BFE6";s:11:"dotNotation";s:11:"Math.3.MD.2";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/3/MD/2";s:10:"currentURL";s:91:"http://www.corestandards.org/the-standards/mathematics/grade-3/measurement-and-data/#3-md-2";}'),
(167, '834B17E279C64263AA83F7625F5D2993', 'Math', 'English', 'Geometric measurement: understand concepts of area and relate area to multiplication and to addition.', 0, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.MD.C', '3.MD.C', 'N;', 'a:4:{s:4:"GUID";s:32:"834B17E279C64263AA83F7625F5D2993";s:11:"dotNotation";s:11:"Math.3.MD.C";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/3/MD/C";s:10:"currentURL";N;}'),
