(169, 'F82EDE7D54704B7F97AB74D10A56D228', 'Math', 'English', 'A square with side length 1 unit, called &quot;a unit square,&quot; is said to have &quot;one square unit&quot; of area, and can be used to measure area.', 0, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.MD.5a', '3.MD.5a', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114369A";s:2:"id";s:8:"S114369A";s:6:"parent";s:8:"S114348A";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"3.MD.5.a";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"F82EDE7D54704B7F97AB74D10A56D228";s:11:"dotNotation";s:12:"Math.3.MD.5a";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/3/MD/5/a";s:10:"currentURL";N;}'),
(170, 'F0B097C190F4482BA735FEC560DA0A7F', 'Math', 'English', 'A plane figure which can be covered without gaps or overlaps by n unit squares is said to have an area of n square units.', 0, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.MD.5b', '3.MD.5b', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114369B";s:2:"id";s:8:"S114369B";s:6:"parent";s:8:"S114348A";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"3.MD.5.b";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"F0B097C190F4482BA735FEC560DA0A7F";s:11:"dotNotation";s:12:"Math.3.MD.5b";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/3/MD/5/b";s:10:"currentURL";N;}'),
(171, 'E0F954B85C7648AFBC3E993420559C1B', 'Math', 'English', 'Measure areas by counting unit squares (square cm, square m, square in, square ft, and improvised units).', 6, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.MD.6', '3.MD.6', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114348B";s:2:"id";s:8:"S114348B";s:6:"parent";s:8:"S1143475";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"3.MD.6";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"E0F954B85C7648AFBC3E993420559C1B";s:11:"dotNotation";s:11:"Math.3.MD.6";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/3/MD/6";s:10:"currentURL";s:91:"http://www.corestandards.org/the-standards/mathematics/grade-3/measurement-and-data/#3-md-6";}'),
(172, 'DB1670D9BA2E4F6BA040EEA5EE826670', 'Math', 'English', 'Relate area to the operations of multiplication and addition.', 7, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.MD.7', '3.MD.7', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114348C";s:2:"id";s:8:"S114348C";s:6:"parent";s:8:"S1143475";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"3.MD.7";s:3:"cls";s:6:"folder";}', 'a:4:{s:4:"GUID";s:32:"DB1670D9BA2E4F6BA040EEA5EE826670";s:11:"dotNotation";s:11:"Math.3.MD.7";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/3/MD/7";s:10:"currentURL";s:91:"http://www.corestandards.org/the-standards/mathematics/grade-3/measurement-and-data/#3-md-7";}'),
(173, '83167CA50D1442788B85C6140A20E39D', 'Math', 'English', 'Find the area of a rectangle with whole-number side lengths by tiling it, and show that the area is the same as would be found by multiplying the side lengths.', 0, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.MD.7a', '3.MD.7a', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114369C";s:2:"id";s:8:"S114369C";s:6:"parent";s:8:"S114348C";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"3.MD.7.a";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"83167CA50D1442788B85C6140A20E39D";s:11:"dotNotation";s:12:"Math.3.MD.7a";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/3/MD/7/a";s:10:"currentURL";N;}'),
(174, 'C18643B92D4D47398EC8F283A2947631', 'Math', 'English', 'Multiply side lengths to find areas of rectangles with whole-number side lengths in the context of solving real world and mathematical problems, and represent whole-number products as rectangular areas in mathematical reasoning.', 0, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.MD.7b', '3.MD.7b', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114369D";s:2:"id";s:8:"S114369D";s:6:"parent";s:8:"S114348C";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"3.MD.7.b";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"C18643B92D4D47398EC8F283A2947631";s:11:"dotNotation";s:12:"Math.3.MD.7b";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/3/MD/7/b";s:10:"currentURL";N;}'),
(175, '4E5415C8BEA348EEA13B1A1C825A5036', 'Math', 'English', 'Use tiling to show in a concrete case that the area of a rectangle with whole-number side lengths a and b + c is the sum of a Ã— b and a Ã— c. Use area models to represent the distributive property in mathematical reasoning.', 0, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.MD.7c', '3.MD.7c', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114369E";s:2:"id";s:8:"S114369E";s:6:"parent";s:8:"S114348C";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"3.MD.7.c";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"4E5415C8BEA348EEA13B1A1C825A5036";s:11:"dotNotation";s:12:"Math.3.MD.7c";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/3/MD/7/c";s:10:"currentURL";N;}'),
(176, 'B0DFFB3792F84CDAACFF99CE6F0381C6', 'Math', 'English', 'Recognize area as additive. Find areas of rectilinear figures by decomposing them into non-overlapping rectangles and adding the areas of the non-overlapping parts, applying this technique to solve real world problems.', 0, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.MD.7d', '3.MD.7d', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114369F";s:2:"id";s:8:"S114369F";s:6:"parent";s:8:"S114348C";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"3.MD.7.d";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"B0DFFB3792F84CDAACFF99CE6F0381C6";s:11:"dotNotation";s:12:"Math.3.MD.7d";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/3/MD/7/d";s:10:"currentURL";N;}'),
(177, 'EE8FEE0FAA2F435496406A7EA6CCFC56', 'Math', 'English', 'Geometric measurement: recognize perimeter as an attribute of plane figures and distinguish between linear and area measures.', 0, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.MD.D', '3.MD.D', 'N;', 'a:4:{s:4:"GUID";s:32:"EE8FEE0FAA2F435496406A7EA6CCFC56";s:11:"dotNotation";s:11:"Math.3.MD.D";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/3/MD/D";s:10:"currentURL";N;}'),
(178, '5FA749A7CE0D48B48CA8D925DF4ABDFD', 'Math', 'English', 'Solve real world and mathematical problems involving perimeters of polygons, including finding the perimeter given the side lengths, finding an unknown side length, and exhibiting rectangles with the same perimeter and different areas or with the same area and different perimeters.', 8, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.MD.8', '3.MD.8', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114348D";s:2:"id";s:8:"S114348D";s:6:"parent";s:8:"S1143476";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"3.MD.8";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"5FA749A7CE0D48B48CA8D925DF4ABDFD";s:11:"dotNotation";s:11:"Math.3.MD.8";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/3/MD/8";s:10:"currentURL";s:91:"http://www.corestandards.org/the-standards/mathematics/grade-3/measurement-and-data/#3-md-8";}'),
(179, '618C4BCCE83C4945B4B5F627C87798FE', 'Math', 'English', 'Solve problems involving measurement and conversion of measurements from a larger unit to a smaller unit.', 0, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.MD.A', '4.MD.A', 'N;', 'a:4:{s:4:"GUID";s:32:"618C4BCCE83C4945B4B5F627C87798FE";s:11:"dotNotation";s:11:"Math.4.MD.A";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/MD/A";s:10:"currentURL";N;}'),
(180, 'D6E6BDF894CE43D89B074BF35BEB24A7', 'Math', 'English', 'Know relative sizes of measurement units within one system of units including km, m, cm; kg, g; lb, oz.; l, ml; hr, min, sec. Within a single system of measurement, express measurements in a larger unit in terms of a smaller unit. Record measurement equivalents in a two column table.', 1, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.MD.1', '4.MD.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434AC";s:2:"id";s:8:"S11434AC";s:6:"parent";s:8:"S1143497";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"4.MD.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"D6E6BDF894CE43D89B074BF35BEB24A7";s:11:"dotNotation";s:11:"Math.4.MD.1";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/MD/1";s:10:"currentURL";s:91:"http://www.corestandards.org/the-standards/mathematics/grade-4/measurement-and-data/#4-md-1";}'),
(181, '5C63D948361B4814BFF237D6F97ED6E1', 'Math', 'English', 'Use the four operations to solve word problems involving distances, intervals of time, liquid volumes, masses of objects, and money, including problems involving simple fractions or decimals, and problems that require expressing measurements given in a larger unit in terms of a smaller unit. Represent measurement quantities using diagrams such as number line diagrams that feature a measurement scale.', 2, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.MD.2', '4.MD.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434AD";s:2:"id";s:8:"S11434AD";s:6:"parent";s:8:"S1143497";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"4.MD.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"5C63D948361B4814BFF237D6F97ED6E1";s:11:"dotNotation";s:11:"Math.4.MD.2";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/MD/2";s:10:"currentURL";s:91:"http://www.corestandards.org/the-standards/mathematics/grade-4/measurement-and-data/#4-md-2";}'),
(182, 'A19298FADD5945B29D8547168CC4783C', 'Math', 'English', 'Apply the area and perimeter formulas for rectangles in real world and mathematical problems.', 3, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.MD.3', '4.MD.3', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434AE";s:2:"id";s:8:"S11434AE";s:6:"parent";s:8:"S1143497";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"4.MD.3";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"A19298FADD5945B29D8547168CC4783C";s:11:"dotNotation";s:11:"Math.4.MD.3";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/MD/3";s:10:"currentURL";s:91:"http://www.corestandards.org/the-standards/mathematics/grade-4/measurement-and-data/#4-md-3";}'),
(183, 'BBBDB104931D41A0B3436D9DFC5E36C0', 'Math', 'English', 'Geometric measurement: understand concepts of angle and measure angles.', 0, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.MD.C', '4.MD.C', 'N;', 'a:4:{s:4:"GUID";s:32:"BBBDB104931D41A0B3436D9DFC5E36C0";s:11:"dotNotation";s:11:"Math.4.MD.C";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/MD/C";s:10:"currentURL";N;}'),
(184, '3ECC888B18184139A496F870F884FCC0', 'Math', 'English', 'Recognize angles as geometric shapes that are formed wherever two rays share a common endpoint, and understand concepts of angle measurement:', 5, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.MD.5', '4.MD.5', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434B0";s:2:"id";s:8:"S11434B0";s:6:"parent";s:8:"S1143498";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"4.MD.5";s:3:"cls";s:6:"folder";}', 'a:4:{s:4:"GUID";s:32:"3ECC888B18184139A496F870F884FCC0";s:11:"dotNotation";s:11:"Math.4.MD.5";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/MD/5";s:10:"currentURL";s:91:"http://www.corestandards.org/the-standards/mathematics/grade-4/measurement-and-data/#4-md-5";}'),
(185, '56F1AA30380B4D998B334C2741E398A1', 'Math', 'English', 'An angle is measured with reference to a circle with its center at the common endpoint of the rays, by considering the fraction of the circular arc between the points where the two rays intersect the circle. An angle that turns through 1/360 of a circle is called a &quot;one-degree angle,&quot; and can be used to measure angles.', 0, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.MD.5a', '4.MD.5a', 'a:6:{s:2:"id";N;s:6:"parent";s:8:"S11434B0";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"4.MD.5.a";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"56F1AA30380B4D998B334C2741E398A1";s:11:"dotNotation";s:12:"Math.4.MD.5a";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/4/MD/5/a";s:10:"currentURL";N;}'),
(186, 'A5B4E57485C849E1B96A79E4F3CF9E75', 'Math', 'English', 'An angle that turns through n one-degree angles is said to have an angle measure of n degrees.', 0, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.MD.5b', '4.MD.5b', 'a:6:{s:2:"id";N;s:6:"parent";s:8:"S11434B0";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"4.MD.5.b";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"A5B4E57485C849E1B96A79E4F3CF9E75";s:11:"dotNotation";s:12:"Math.4.MD.5b";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/4/MD/5/b";s:10:"currentURL";N;}'),
(187, '8FBBE0F101074A9EBEC26C1461FB9761', 'Math', 'English', 'Measure angles in whole-number degrees using a protractor. Sketch angles of specified measure.', 6, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.MD.6', '4.MD.6', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434B1";s:2:"id";s:8:"S11434B1";s:6:"parent";s:8:"S1143498";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"4.MD.6";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"8FBBE0F101074A9EBEC26C1461FB9761";s:11:"dotNotation";s:11:"Math.4.MD.6";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/MD/6";s:10:"currentURL";s:91:"http://www.corestandards.org/the-standards/mathematics/grade-4/measurement-and-data/#4-md-6";}'),
(188, 'A8940EF40A0F4CDF98E6252FC55CF66B', 'Math', 'English', 'Recognize angle measure as additive. When an angle is decomposed into non-overlapping parts, the angle measure of the whole is the sum of the angle measures of the parts. Solve addition and subtraction problems to find unknown angles on a diagram in real world and mathematical problems, e.g., by using an equation with a symbol for the unknown angle measure.', 7, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.MD.7', '4.MD.7', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434B2";s:2:"id";s:8:"S11434B2";s:6:"parent";s:8:"S1143498";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"4.MD.7";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"A8940EF40A0F4CDF98E6252FC55CF66B";s:11:"dotNotation";s:11:"Math.4.MD.7";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/MD/7";s:10:"currentURL";s:91:"http://www.corestandards.org/the-standards/mathematics/grade-4/measurement-and-data/#4-md-7";}'),
(189, 'DC3BDA42AAD245D6AD4025C0C1AA61F1', 'Math', 'English', 'Convert like measurement units within a given measurement system.', 0, 'a:1:{i:0;s:2:"05";}', 'Common Core State Standards Initiative', 'CC', 'Grade 5', 'Math.5.MD.A', '5.MD.A', 'N;', 'a:4:{s:4:"GUID";s:32:"DC3BDA42AAD245D6AD4025C0C1AA61F1";s:11:"dotNotation";s:11:"Math.5.MD.A";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/5/MD/A";s:10:"currentURL";N;}'),
(190, '2D0ABC2082044403BD1260D7E8535AA0', 'Math', 'English', 'Convert among different-sized standard measurement units within a given measurement system (e.g., convert 5 cm to 0.05 m), and use these conversions in solving multi-step, real world problems.', 1, 'a:1:{i:0;s:2:"05";}', 'Common Core State Standards Initiative', 'CC', 'Grade 5', 'Math.5.MD.1', '5.MD.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434FC";s:2:"id";s:8:"S11434FC";s:6:"parent";s:8:"S11434BC";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"5.MD.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"2D0ABC2082044403BD1260D7E8535AA0";s:11:"dotNotation";s:11:"Math.5.MD.1";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/5/MD/1";s:10:"currentURL";s:91:"http://www.corestandards.org/the-standards/mathematics/grade-5/measurement-and-data/#5-md-1";}'),
(191, '295D70687EC34B7C87B27C0D3D9A39AA', 'Math', 'English', 'Geometric measurement: understand concepts of volume and relate volume to multiplication and to addition.', 0, 'a:1:{i:0;s:2:"05";}', 'Common Core State Standards Initiative', 'CC', 'Grade 5', 'Math.5.MD.C', '5.MD.C', 'N;', 'a:4:{s:4:"GUID";s:32:"295D70687EC34B7C87B27C0D3D9A39AA";s:11:"dotNotation";s:11:"Math.5.MD.C";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/5/MD/C";s:10:"currentURL";N;}'),
(192, '36D5E16885004574B88BAF6886FA2911', 'Math', 'English', 'Recognize volume as an attribute of solid figures and understand concepts of volume measurement.', 3, 'a:1:{i:0;s:2:"05";}', 'Common Core State Standards Initiative', 'CC', 'Grade 5', 'Math.5.MD.3', '5.MD.3', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434FE";s:2:"id";s:8:"S11434FE";s:6:"parent";s:8:"S11434BD";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"5.MD.3";s:3:"cls";s:6:"folder";}', 'a:4:{s:4:"GUID";s:32:"36D5E16885004574B88BAF6886FA2911";s:11:"dotNotation";s:11:"Math.5.MD.3";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/5/MD/3";s:10:"currentURL";s:91:"http://www.corestandards.org/the-standards/mathematics/grade-5/measurement-and-data/#5-md-3";}'),
(193, '164CCBB72823487A88079EC2593D9354', 'Math', 'English', 'A cube with side length 1 unit, called a &quot;unit cube,&quot; is said to have &quot;one cubic unit&quot; of volume, and can be used to measure volume.', 0, 'a:1:{i:0;s:2:"05";}', 'Common Core State Standards Initiative', 'CC', 'Grade 5', 'Math.5.MD.3a', '5.MD.3a', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11436A0";s:2:"id";s:8:"S11436A0";s:6:"parent";s:8:"S11434FE";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"5.MD.3.a";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"164CCBB72823487A88079EC2593D9354";s:11:"dotNotation";s:12:"Math.5.MD.3a";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/5/MD/3/a";s:10:"currentURL";N;}'),
(194, 'E92C6ADEAB084243BE335C4B561D1CEA', 'Math', 'English', 'A solid figure which can be packed without gaps or overlaps using n unit cubes is said to have a volume of n cubic units.', 0, 'a:1:{i:0;s:2:"05";}', 'Common Core State Standards Initiative', 'CC', 'Grade 5', 'Math.5.MD.3b', '5.MD.3b', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11436A1";s:2:"id";s:8:"S11436A1";s:6:"parent";s:8:"S11434FE";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"5.MD.3.b";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"E92C6ADEAB084243BE335C4B561D1CEA";s:11:"dotNotation";s:12:"Math.5.MD.3b";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/5/MD/3/b";s:10:"currentURL";N;}'),
(195, 'EDE82892A19749A9A8A1EF89D36F403D', 'Math', 'English', 'Measure volumes by counting unit cubes, using cubic cm, cubic in, cubic ft, and improvised units.', 4, 'a:1:{i:0;s:2:"05";}', 'Common Core State Standards Initiative', 'CC', 'Grade 5', 'Math.5.MD.4', '5.MD.4', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434FF";s:2:"id";s:8:"S11434FF";s:6:"parent";s:8:"S11434BD";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"5.MD.4";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"EDE82892A19749A9A8A1EF89D36F403D";s:11:"dotNotation";s:11:"Math.5.MD.4";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/5/MD/4";s:10:"currentURL";s:91:"http://www.corestandards.org/the-standards/mathematics/grade-5/measurement-and-data/#5-md-4";}'),
(196, 'B8EEE0176EDE4F9998AB63E1055E0068', 'Math', 'English', 'Relate volume to the operations of multiplication and addition and solve real world and mathematical problems involving volume.', 5, 'a:1:{i:0;s:2:"05";}', 'Common Core State Standards Initiative', 'CC', 'Grade 5', 'Math.5.MD.5', '5.MD.5', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143500";s:2:"id";s:8:"S1143500";s:6:"parent";s:8:"S11434BD";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"5.MD.5";s:3:"cls";s:6:"folder";}', 'a:4:{s:4:"GUID";s:32:"B8EEE0176EDE4F9998AB63E1055E0068";s:11:"dotNotation";s:11:"Math.5.MD.5";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/5/MD/5";s:10:"currentURL";s:91:"http://www.corestandards.org/the-standards/mathematics/grade-5/measurement-and-data/#5-md-5";}'),
(197, '90E0C13F4411422189D10B2BB526E609', 'Math', 'English', 'Find the volume of a right rectangular prism with whole-number side lengths by packing it with unit cubes, and show that the volume is the same as would be found by multiplying the edge lengths, equivalently by multiplying the height by the area of the base. Represent threefold whole-number products as volumes, e.g., to represent the associative property of multiplication.', 0, 'a:1:{i:0;s:2:"05";}', 'Common Core State Standards Initiative', 'CC', 'Grade 5', 'Math.5.MD.5a', '5.MD.5a', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11436A2";s:2:"id";s:8:"S11436A2";s:6:"parent";s:8:"S1143500";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"5.MD.5.a";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"90E0C13F4411422189D10B2BB526E609";s:11:"dotNotation";s:12:"Math.5.MD.5a";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/5/MD/5/a";s:10:"currentURL";N;}'),
(198, 'C5BB4D4030BE40A4A51FD07282BBEF75', 'Math', 'English', 'Apply the formulas V = l Ã— w Ã— h and V = b Ã— h for rectangular prisms to find volumes of right rectangular prisms with whole-number edge lengths in the context of solving real world and mathematical problems.', 0, 'a:1:{i:0;s:2:"05";}', 'Common Core State Standards Initiative', 'CC', 'Grade 5', 'Math.5.MD.5b', '5.MD.5b', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11436A3";s:2:"id";s:8:"S11436A3";s:6:"parent";s:8:"S1143500";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"5.MD.5.b";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"C5BB4D4030BE40A4A51FD07282BBEF75";s:11:"dotNotation";s:12:"Math.5.MD.5b";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/5/MD/5/b";s:10:"currentURL";N;}');
INSERT INTO `cc_math` (`pk`, `id`, `subject`, `language`, `statement`, `listIdentifier`, `gradeLevels`, `jurisdiction`, `jurisdictionAbbreviation`, `gradeLevel`, `code`, `shortCode`, `ASN`, `CCSS`) VALUES
(199, '6B05F71ECDDA44CB9148AC09EB30CE9C', 'Math', 'English', 'Recognize volume as additive. Find volumes of solid figures composed of two non-overlapping right rectangular prisms by adding the volumes of the non-overlapping parts, applying this technique to solve real world problems.', 0, 'a:1:{i:0;s:2:"05";}', 'Common Core State Standards Initiative', 'CC', 'Grade 5', 'Math.5.MD.5c', '5.MD.5c', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11436A4";s:2:"id";s:8:"S11436A4";s:6:"parent";s:8:"S1143500";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"5.MD.5.c";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"6B05F71ECDDA44CB9148AC09EB30CE9C";s:11:"dotNotation";s:12:"Math.5.MD.5c";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/5/MD/5/c";s:10:"currentURL";N;}'),
