(213, '695C21D7C2ED45838FDDBBA3E48FDF14', 'Math', 'English', 'Distinguish between defining attributes (e.g., triangles are closed and three-sided) versus non-defining attributes (e.g., color, orientation, overall size); build and draw shapes to possess defining attributes.', 1, 'a:1:{i:0;s:2:"01";}', 'Common Core State Standards Initiative', 'CC', 'Grade 1', 'Math.1.G.1', '1.G.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114344A";s:2:"id";s:8:"S114344A";s:6:"parent";s:8:"S1143437";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"1.G.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"695C21D7C2ED45838FDDBBA3E48FDF14";s:11:"dotNotation";s:10:"Math.1.G.1";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/1/G/1";s:10:"currentURL";s:78:"http://www.corestandards.org/the-standards/mathematics/grade-1/geometry/#1-g-1";}'),
(214, 'F48B95FFE5F9481086A6668B635A07F5', 'Math', 'English', 'Compose two-dimensional shapes (rectangles, squares, trapezoids, triangles, half-circles, and quarter-circles) or three-dimensional shapes (cubes, right rectangular prisms, right circular cones, and right circular cylinders) to create a composite shape, and compose new shapes from the composite shape.', 2, 'a:1:{i:0;s:2:"01";}', 'Common Core State Standards Initiative', 'CC', 'Grade 1', 'Math.1.G.2', '1.G.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114344B";s:2:"id";s:8:"S114344B";s:6:"parent";s:8:"S1143437";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"1.G.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"F48B95FFE5F9481086A6668B635A07F5";s:11:"dotNotation";s:10:"Math.1.G.2";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/1/G/2";s:10:"currentURL";s:78:"http://www.corestandards.org/the-standards/mathematics/grade-1/geometry/#1-g-2";}'),
(215, 'C4D09FCFEBA140FDB513430B4C182C3F', 'Math', 'English', 'Partition circles and rectangles into two and four equal shares, describe the shares using the words halves, fourths, and quarters, and use the phrases half of, fourth of, and quarter of. Describe the whole as two of, or four of the shares. Understand for these examples that decomposing into more equal shares creates smaller shares.', 3, 'a:1:{i:0;s:2:"01";}', 'Common Core State Standards Initiative', 'CC', 'Grade 1', 'Math.1.G.3', '1.G.3', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114344C";s:2:"id";s:8:"S114344C";s:6:"parent";s:8:"S1143437";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"1.G.3";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"C4D09FCFEBA140FDB513430B4C182C3F";s:11:"dotNotation";s:10:"Math.1.G.3";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/1/G/3";s:10:"currentURL";s:78:"http://www.corestandards.org/the-standards/mathematics/grade-1/geometry/#1-g-3";}'),
(216, '61864044228F4141AF5A894EC059DFB7', 'Math', 'English', 'Recognize and draw shapes having specified attributes, such as a given number of angles or a given number of equal faces. Identify triangles, quadrilaterals, pentagons, hexagons, and cubes.', 1, 'a:1:{i:0;s:2:"02";}', 'Common Core State Standards Initiative', 'CC', 'Grade 2', 'Math.2.G.1', '2.G.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114346A";s:2:"id";s:8:"S114346A";s:6:"parent";s:8:"S1143437";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"2.G.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"61864044228F4141AF5A894EC059DFB7";s:11:"dotNotation";s:10:"Math.2.G.1";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/2/G/1";s:10:"currentURL";s:78:"http://www.corestandards.org/the-standards/mathematics/grade-2/geometry/#2-g-1";}'),
(217, '72351776259D416CB0A38EEBF8590435', 'Math', 'English', 'Partition a rectangle into rows and columns of same-size squares and count to find the total number of them.', 2, 'a:1:{i:0;s:2:"02";}', 'Common Core State Standards Initiative', 'CC', 'Grade 2', 'Math.2.G.2', '2.G.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114346B";s:2:"id";s:8:"S114346B";s:6:"parent";s:8:"S1143437";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"2.G.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"72351776259D416CB0A38EEBF8590435";s:11:"dotNotation";s:10:"Math.2.G.2";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/2/G/2";s:10:"currentURL";s:78:"http://www.corestandards.org/the-standards/mathematics/grade-2/geometry/#2-g-2";}'),
(218, 'FB8B502B82B44672A489DEDC94283ABD', 'Math', 'English', 'Partition circles and rectangles into two, three, or four equal shares, describe the shares using the words halves, thirds, half of, a third of, etc., and describe the whole as two halves, three thirds, four fourths. Recognize that equal shares of identical wholes need not have the same shape.', 3, 'a:1:{i:0;s:2:"02";}', 'Common Core State Standards Initiative', 'CC', 'Grade 2', 'Math.2.G.3', '2.G.3', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114346C";s:2:"id";s:8:"S114346C";s:6:"parent";s:8:"S1143437";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"2.G.3";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"FB8B502B82B44672A489DEDC94283ABD";s:11:"dotNotation";s:10:"Math.2.G.3";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/2/G/3";s:10:"currentURL";s:78:"http://www.corestandards.org/the-standards/mathematics/grade-2/geometry/#2-g-3";}'),
(219, '547195B83B9A4BDC9D8E61313975523B', 'Math', 'English', 'Understand that shapes in different categories (e.g., rhombuses, rectangles, and others) may share attributes (e.g., having four sides), and that the shared attributes can define a larger category (e.g., quadrilaterals). Recognize rhombuses, rectangles, and squares as examples of quadrilaterals, and draw examples of quadrilaterals that do not belong to any of these subcategories.', 1, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.G.1', '3.G.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114348E";s:2:"id";s:8:"S114348E";s:6:"parent";s:8:"S1143437";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"3.G.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"547195B83B9A4BDC9D8E61313975523B";s:11:"dotNotation";s:10:"Math.3.G.1";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/3/G/1";s:10:"currentURL";s:78:"http://www.corestandards.org/the-standards/mathematics/grade-3/geometry/#3-g-1";}'),
(220, '368CBD5C10534702841D3C659B5DAC65', 'Math', 'English', 'Partition shapes into parts with equal areas. Express the area of each part as a unit fraction of the whole.', 2, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.G.2', '3.G.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114348F";s:2:"id";s:8:"S114348F";s:6:"parent";s:8:"S1143437";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"3.G.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"368CBD5C10534702841D3C659B5DAC65";s:11:"dotNotation";s:10:"Math.3.G.2";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/3/G/2";s:10:"currentURL";s:78:"http://www.corestandards.org/the-standards/mathematics/grade-3/geometry/#3-g-2";}'),
(221, '0B670B7BA80B457D82D11DD3D54DCE92', 'Math', 'English', 'Draw and identify lines and angles, and classify shapes by properties of their lines and angles.', 0, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.G.A', '4.G.A', 'N;', 'a:4:{s:4:"GUID";s:32:"0B670B7BA80B457D82D11DD3D54DCE92";s:11:"dotNotation";s:10:"Math.4.G.A";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/4/G/A";s:10:"currentURL";N;}'),
(222, 'EE2F4A7279304A699452983BE09CA2A0', 'Math', 'English', 'Draw points, lines, line segments, rays, angles (right, acute, obtuse), and perpendicular and parallel lines. Identify these in two-dimensional figures.', 1, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.G.1', '4.G.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434B3";s:2:"id";s:8:"S11434B3";s:6:"parent";s:8:"S1143499";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"4.G.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"EE2F4A7279304A699452983BE09CA2A0";s:11:"dotNotation";s:10:"Math.4.G.1";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/4/G/1";s:10:"currentURL";s:78:"http://www.corestandards.org/the-standards/mathematics/grade-4/geometry/#4-g-1";}'),
(223, 'F2457F2D8F574726BB094F391822B030', 'Math', 'English', 'Classify two-dimensional figures based on the presence or absence of parallel or perpendicular lines, or the presence or absence of angles of a specified size. Recognize right triangles as a category, and identify right triangles.', 2, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.G.2', '4.G.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434B4";s:2:"id";s:8:"S11434B4";s:6:"parent";s:8:"S1143499";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"4.G.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"F2457F2D8F574726BB094F391822B030";s:11:"dotNotation";s:10:"Math.4.G.2";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/4/G/2";s:10:"currentURL";s:78:"http://www.corestandards.org/the-standards/mathematics/grade-4/geometry/#4-g-2";}'),
(224, 'B6CC34045B7B45F48CE0080E44852EEA', 'Math', 'English', 'Recognize a line of symmetry for a two-dimensional figure as a line across the figure such that the figure can be folded along the line into matching parts. Identify line-symmetric figures and draw lines of symmetry.', 3, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.G.3', '4.G.3', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434B5";s:2:"id";s:8:"S11434B5";s:6:"parent";s:8:"S1143499";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"4.G.3";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"B6CC34045B7B45F48CE0080E44852EEA";s:11:"dotNotation";s:10:"Math.4.G.3";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/4/G/3";s:10:"currentURL";s:78:"http://www.corestandards.org/the-standards/mathematics/grade-4/geometry/#4-g-3";}'),
(225, '3363FCD84F3C4CB4B928C0BE1151DBDC', 'Math', 'English', 'Graph points on the coordinate plane to solve real-world and mathematical problems.', 0, 'a:1:{i:0;s:2:"05";}', 'Common Core State Standards Initiative', 'CC', 'Grade 5', 'Math.5.G.A', '5.G.A', 'N;', 'a:4:{s:4:"GUID";s:32:"3363FCD84F3C4CB4B928C0BE1151DBDC";s:11:"dotNotation";s:10:"Math.5.G.A";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/5/G/A";s:10:"currentURL";N;}'),
(226, '18DAB6D1049C43D8931A96EF74B1A08B', 'Math', 'English', 'Use a pair of perpendicular number lines, called axes, to define a coordinate system, with the intersection of the lines (the origin) arranged to coincide with the 0 on each line and a given point in the plane located by using an ordered pair of numbers, called its coordinates. Understand that the first number indicates how far to travel from the origin in the direction of one axis, and the second number indicates how far to travel in the direction of the second axis, with the convention that the names of the two axes and the coordinates correspond (e.g., x-axis and x-coordinate, y-axis and y-coordinate).', 1, 'a:1:{i:0;s:2:"05";}', 'Common Core State Standards Initiative', 'CC', 'Grade 5', 'Math.5.G.1', '5.G.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143501";s:2:"id";s:8:"S1143501";s:6:"parent";s:8:"S11434BE";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"5.G.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"18DAB6D1049C43D8931A96EF74B1A08B";s:11:"dotNotation";s:10:"Math.5.G.1";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/5/G/1";s:10:"currentURL";s:78:"http://www.corestandards.org/the-standards/mathematics/grade-5/geometry/#5-g-1";}'),
(227, '7F14BA6D3F05420A8EACE9D87556A240', 'Math', 'English', 'Represent real world and mathematical problems by graphing points in the first quadrant of the coordinate plane, and interpret coordinate values of points in the context of the situation.', 2, 'a:1:{i:0;s:2:"05";}', 'Common Core State Standards Initiative', 'CC', 'Grade 5', 'Math.5.G.2', '5.G.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143502";s:2:"id";s:8:"S1143502";s:6:"parent";s:8:"S11434BE";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"5.G.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"7F14BA6D3F05420A8EACE9D87556A240";s:11:"dotNotation";s:10:"Math.5.G.2";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/5/G/2";s:10:"currentURL";s:78:"http://www.corestandards.org/the-standards/mathematics/grade-5/geometry/#5-g-2";}'),
(228, '5C683021E8394B7597AE0222D0BBE59E', 'Math', 'English', 'Classify two-dimensional figures into categories based on their properties.', 0, 'a:1:{i:0;s:2:"05";}', 'Common Core State Standards Initiative', 'CC', 'Grade 5', 'Math.5.G.B', '5.G.B', 'N;', 'a:4:{s:4:"GUID";s:32:"5C683021E8394B7597AE0222D0BBE59E";s:11:"dotNotation";s:10:"Math.5.G.B";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/5/G/B";s:10:"currentURL";N;}'),
(229, '4A929DB5A41A4DD192F3B7790EBF0B8F', 'Math', 'English', 'Understand that attributes belonging to a category of two-dimensional figures also belong to all subcategories of that category.', 3, 'a:1:{i:0;s:2:"05";}', 'Common Core State Standards Initiative', 'CC', 'Grade 5', 'Math.5.G.3', '5.G.3', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143503";s:2:"id";s:8:"S1143503";s:6:"parent";s:8:"S11434BF";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"5.G.3";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"4A929DB5A41A4DD192F3B7790EBF0B8F";s:11:"dotNotation";s:10:"Math.5.G.3";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/5/G/3";s:10:"currentURL";s:78:"http://www.corestandards.org/the-standards/mathematics/grade-5/geometry/#5-g-3";}'),
(230, '82F6249E2DC446BD9DF8CC224D03D6B6', 'Math', 'English', 'Classify two-dimensional figures in a hierarchy based on properties.', 4, 'a:1:{i:0;s:2:"05";}', 'Common Core State Standards Initiative', 'CC', 'Grade 5', 'Math.5.G.4', '5.G.4', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143504";s:2:"id";s:8:"S1143504";s:6:"parent";s:8:"S11434BF";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"5.G.4";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"82F6249E2DC446BD9DF8CC224D03D6B6";s:11:"dotNotation";s:10:"Math.5.G.4";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/5/G/4";s:10:"currentURL";s:78:"http://www.corestandards.org/the-standards/mathematics/grade-5/geometry/#5-g-4";}'),
(231, '4672773E1A8744EEA5318249CA2D8884', 'Math', 'English', 'Solve real-world and mathematical problems involving area, surface area, and volume.', 0, 'a:1:{i:0;s:2:"06";}', 'Common Core State Standards Initiative', 'CC', 'Grade 6', 'Math.6.G.A', '6.G.A', 'N;', 'a:4:{s:4:"GUID";s:32:"4672773E1A8744EEA5318249CA2D8884";s:11:"dotNotation";s:10:"Math.6.G.A";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/6/G/A";s:10:"currentURL";N;}'),
(232, '1F31DD363906484D9D2779A34FB59610', 'Math', 'English', 'Find the area of right triangles, other triangles, special quadrilaterals, and polygons by composing into rectangles or decomposing into triangles and other shapes; apply these techniques in the context of solving real-world and mathematical problems.', 1, 'a:1:{i:0;s:2:"06";}', 'Common Core State Standards Initiative', 'CC', 'Grade 6', 'Math.6.G.1', '6.G.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434E2";s:2:"id";s:8:"S11434E2";s:6:"parent";s:8:"S11434CA";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"6.G.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"1F31DD363906484D9D2779A34FB59610";s:11:"dotNotation";s:10:"Math.6.G.1";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/6/G/1";s:10:"currentURL";s:78:"http://www.corestandards.org/the-standards/mathematics/grade-6/geometry/#6-g-1";}'),
(233, '5436DB65E9124351A1106B298F5BE264', 'Math', 'English', 'Find the volume of a right rectangular prism with fractional edge lengths by packing it with unit cubes of the appropriate unit fraction edge lengths, and show that the volume is the same as would be found by multiplying the edge lengths of the prism. Apply the formulas V = l w h and V = b h to find volumes of right rectangular prisms with fractional edge lengths in the context of solving real-world and mathematical problems.', 2, 'a:1:{i:0;s:2:"06";}', 'Common Core State Standards Initiative', 'CC', 'Grade 6', 'Math.6.G.2', '6.G.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434E3";s:2:"id";s:8:"S11434E3";s:6:"parent";s:8:"S11434CA";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"6.G.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"5436DB65E9124351A1106B298F5BE264";s:11:"dotNotation";s:10:"Math.6.G.2";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/6/G/2";s:10:"currentURL";s:78:"http://www.corestandards.org/the-standards/mathematics/grade-6/geometry/#6-g-2";}'),
