(263, '74D0C6FACE7E4939BD8B01C5E729871C', 'Math', 'English', 'Represent a fraction 1/b on a number line diagram by defining the interval from 0 to 1 as the whole and partitioning it into b equal parts. Recognize that each part has size 1/b and that the endpoint of the part based at 0 locates the number 1/b on the number line.', 0, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.NF.2a', '3.NF.2a', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114368F";s:2:"id";s:8:"S114368F";s:6:"parent";s:8:"S1143484";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"3.NF.2.a";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"74D0C6FACE7E4939BD8B01C5E729871C";s:11:"dotNotation";s:12:"Math.3.NF.2a";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/3/NF/2/a";s:10:"currentURL";N;}');
