(264, 'D31E57DF888541EAA539B9C1954C76E1', 'Math', 'English', 'Represent a fraction a/b on a number line diagram by marking off a lengths 1/b from 0. Recognize that the resulting interval has size a/b and that its endpoint locates the number a/b on the number line.', 0, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.NF.2b', '3.NF.2b', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143690";s:2:"id";s:8:"S1143690";s:6:"parent";s:8:"S1143484";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"3.NF.2.b";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"D31E57DF888541EAA539B9C1954C76E1";s:11:"dotNotation";s:12:"Math.3.NF.2b";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/3/NF/2/b";s:10:"currentURL";N;}'),
