(266, 'F80BD4BFFDB946DCB74AFA807DF07F0C', 'Math', 'English', 'Understand two fractions as equivalent (equal) if they are the same size, or the same point on a number line.', 0, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.NF.3a', '3.NF.3a', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143691";s:2:"id";s:8:"S1143691";s:6:"parent";s:8:"S1143485";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"3.NF.3.a";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"F80BD4BFFDB946DCB74AFA807DF07F0C";s:11:"dotNotation";s:12:"Math.3.NF.3a";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/3/NF/3/a";s:10:"currentURL";N;}'),
(267, '8A6F987095B24FD8825585A2510C4356', 'Math', 'English', 'Recognize and generate simple equivalent fractions, e.g., 1/2 = 2/4, 4/6 = 2/3). Explain why the fractions are equivalent, e.g., by using a visual fraction model.', 0, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.NF.3b', '3.NF.3b', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143692";s:2:"id";s:8:"S1143692";s:6:"parent";s:8:"S1143485";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"3.NF.3.b";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"8A6F987095B24FD8825585A2510C4356";s:11:"dotNotation";s:12:"Math.3.NF.3b";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/3/NF/3/b";s:10:"currentURL";N;}'),
(268, '70C12332BEED45098AA0A0BBCD977376', 'Math', 'English', 'Express whole numbers as fractions, and recognize fractions that are equivalent to whole numbers.', 0, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.NF.3c', '3.NF.3c', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143693";s:2:"id";s:8:"S1143693";s:6:"parent";s:8:"S1143485";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"3.NF.3.c";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"70C12332BEED45098AA0A0BBCD977376";s:11:"dotNotation";s:12:"Math.3.NF.3c";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/3/NF/3/c";s:10:"currentURL";N;}'),
(269, '43F9FB0B127B45738F173195B04CAF6B', 'Math', 'English', 'Compare two fractions with the same numerator or the same denominator by reasoning about their size. Recognize that comparisons are valid only when the two fractions refer to the same whole. Record the results of comparisons with the symbols &gt;, =, or &lt;, and justify the conclusions, e.g., by using a visual fraction model.', 0, 'a:1:{i:0;s:2:"03";}', 'Common Core State Standards Initiative', 'CC', 'Grade 3', 'Math.3.NF.3d', '3.NF.3d', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143694";s:2:"id";s:8:"S1143694";s:6:"parent";s:8:"S1143485";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"3.NF.3.d";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"43F9FB0B127B45738F173195B04CAF6B";s:11:"dotNotation";s:12:"Math.3.NF.3d";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/3/NF/3/d";s:10:"currentURL";N;}'),
(270, '5E9ED66B8DBE490EB71B397896148D60', 'Math', 'English', 'Extend understanding of fraction equivalence and ordering.', 0, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.NF.A', '4.NF.A', 'N;', 'a:4:{s:4:"GUID";s:32:"5E9ED66B8DBE490EB71B397896148D60";s:11:"dotNotation";s:11:"Math.4.NF.A";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/NF/A";s:10:"currentURL";N;}'),
(271, '138DC8D66B4545BB92DA44D6C78205DD', 'Math', 'English', 'Explain why a fraction a/b is equivalent to a fraction (n Ã— a)/(n Ã— b) by using visual fraction models, with attention to how the number and size of the parts differ even though the two fractions themselves are the same size. Use this principle to recognize and generate equivalent fractions.', 1, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.NF.1', '4.NF.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434A5";s:2:"id";s:8:"S11434A5";s:6:"parent";s:8:"S1143494";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"4.NF.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"138DC8D66B4545BB92DA44D6C78205DD";s:11:"dotNotation";s:11:"Math.4.NF.1";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/NF/1";s:10:"currentURL";s:102:"http://www.corestandards.org/the-standards/mathematics/grade-4/number-and-operations-fractions/#4-nf-1";}'),
(272, '72F5C564F8744643B0876628789CFBC4', 'Math', 'English', 'Compare two fractions with different numerators and different denominators, e.g., by creating common denominators or numerators, or by comparing to a benchmark fraction such as 1/2. Recognize that comparisons are valid only when the two fractions refer to the same whole. Record the results of comparisons with symbols &gt;, =, or &lt;, and justify the conclusions, e.g., by using a visual fraction model.', 2, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.NF.2', '4.NF.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434A6";s:2:"id";s:8:"S11434A6";s:6:"parent";s:8:"S1143494";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"4.NF.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"72F5C564F8744643B0876628789CFBC4";s:11:"dotNotation";s:11:"Math.4.NF.2";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/NF/2";s:10:"currentURL";s:102:"http://www.corestandards.org/the-standards/mathematics/grade-4/number-and-operations-fractions/#4-nf-2";}'),
(273, 'CAF90B8CE96A4458829E7C7C376A7126', 'Math', 'English', 'Build fractions from unit fractions by applying and extending previous understandings of operations on whole numbers.', 0, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.NF.B', '4.NF.B', 'N;', 'a:4:{s:4:"GUID";s:32:"CAF90B8CE96A4458829E7C7C376A7126";s:11:"dotNotation";s:11:"Math.4.NF.B";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/4/NF/B";s:10:"currentURL";N;}'),
