(275, 'F6933013AE4F438BB52517F900140E51', 'Math', 'English', 'Understand addition and subtraction of fractions as joining and separating parts referring to the same whole.', 0, 'a:1:{i:0;s:2:"04";}', 'Common Core State Standards Initiative', 'CC', 'Grade 4', 'Math.4.NF.3a', '4.NF.3a', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114368B";s:2:"id";s:8:"S114368B";s:6:"parent";s:8:"S11434A7";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"4.NF.3.a";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"F6933013AE4F438BB52517F900140E51";s:11:"dotNotation";s:12:"Math.4.NF.3a";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/4/NF/3/a";s:10:"currentURL";N;}'),
