(326, '1F31DD363906484D9D2779A34FB59612', 'Math', 'English', 'Find the greatest common factor of two whole numbers less than or equal to 100 and the least common multiple of two whole numbers less than or equal to 12. Use the distributive property to express a sum of two whole numbers 1â€”100 with a common factor as a multiple of a sum of two whole numbers with no common factor.', 4, 'a:1:{i:0;s:2:"06";}', 'Common Core State Standards Initiative', 'CC', 'Grade 6', 'Math.6.NS.4', '6.NS.4', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434D4";s:2:"id";s:8:"S11434D4";s:6:"parent";s:8:"S11434C4";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"6.NS.4";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"1F31DD363906484D9D2779A34FB59612";s:11:"dotNotation";s:11:"Math.6.NS.4";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/6/NS/4";s:10:"currentURL";s:88:"http://www.corestandards.org/the-standards/mathematics/grade-6/the-number-system/#6-ns-4";}'),
