(328, '01E9170774DA4651B0F75F3093EC40A8', 'Math', 'English', 'Understand that positive and negative numbers are used together to describe quantities having opposite directions or values (e.g., temperature above/below zero, elevation above/below sea level, credits/debits, positive/negative electric charge); use positive and negative numbers to represent quantities in real-world contexts, explaining the meaning of 0 in each situation.', 5, 'a:1:{i:0;s:2:"06";}', 'Common Core State Standards Initiative', 'CC', 'Grade 6', 'Math.6.NS.5', '6.NS.5', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434D5";s:2:"id";s:8:"S11434D5";s:6:"parent";s:8:"S11434C5";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"6.NS.5";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"01E9170774DA4651B0F75F3093EC40A8";s:11:"dotNotation";s:11:"Math.6.NS.5";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/6/NS/5";s:10:"currentURL";s:88:"http://www.corestandards.org/the-standards/mathematics/grade-6/the-number-system/#6-ns-5";}'),
(329, 'A476322A7B9545339733892F2F6BF97F', 'Math', 'English', 'Understand a rational number as a point on the number line. Extend number line diagrams and coordinate axes familiar from previous grades to represent points on the line and in the plane with negative number coordinates.', 6, 'a:1:{i:0;s:2:"06";}', 'Common Core State Standards Initiative', 'CC', 'Grade 6', 'Math.6.NS.6', '6.NS.6', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434D6";s:2:"id";s:8:"S11434D6";s:6:"parent";s:8:"S11434C5";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"6.NS.6";s:3:"cls";s:6:"folder";}', 'a:4:{s:4:"GUID";s:32:"A476322A7B9545339733892F2F6BF97F";s:11:"dotNotation";s:11:"Math.6.NS.6";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/6/NS/6";s:10:"currentURL";s:88:"http://www.corestandards.org/the-standards/mathematics/grade-6/the-number-system/#6-ns-6";}'),
(330, '5EE6ABF39BA64476BBD43564FBF2B2F8', 'Math', 'English', 'Recognize opposite signs of numbers as indicating locations on opposite sides of 0 on the number line; recognize that the opposite of the opposite of a number is the number itself, e.g., â€”(â€”3) = 3, and that 0 is its own opposite.', 0, 'a:1:{i:0;s:2:"06";}', 'Common Core State Standards Initiative', 'CC', 'Grade 6', 'Math.6.NS.6a', '6.NS.6a', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143674";s:2:"id";s:8:"S1143674";s:6:"parent";s:8:"S11434D6";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"6.NS.6.a";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"5EE6ABF39BA64476BBD43564FBF2B2F8";s:11:"dotNotation";s:12:"Math.6.NS.6a";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/6/NS/6/a";s:10:"currentURL";N;}'),
(331, 'C81686A64B584D928944DF54E754B474', 'Math', 'English', 'Understand signs of numbers in ordered pairs as indicating locations in quadrants of the coordinate plane; recognize that when two ordered pairs differ only by signs, the locations of the points are related by reflections across one or both axes.', 0, 'a:1:{i:0;s:2:"06";}', 'Common Core State Standards Initiative', 'CC', 'Grade 6', 'Math.6.NS.6b', '6.NS.6b', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143675";s:2:"id";s:8:"S1143675";s:6:"parent";s:8:"S11434D6";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"6.NS.6.b";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"C81686A64B584D928944DF54E754B474";s:11:"dotNotation";s:12:"Math.6.NS.6b";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/6/NS/6/b";s:10:"currentURL";N;}'),
