(336, 'EDA8659B8F2F468C891C301FF54B210C', 'Math', 'English', 'Understand the absolute value of a rational number as its distance from 0 on the number line; interpret absolute value as magnitude for a positive or negative quantity in a real-world situation.', 0, 'a:1:{i:0;s:2:"06";}', 'Common Core State Standards Initiative', 'CC', 'Grade 6', 'Math.6.NS.7c', '6.NS.7c', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143679";s:2:"id";s:8:"S1143679";s:6:"parent";s:8:"S11434D7";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"6.NS.7.c";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"EDA8659B8F2F468C891C301FF54B210C";s:11:"dotNotation";s:12:"Math.6.NS.7c";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/6/NS/7/c";s:10:"currentURL";N;}'),
