(338, 'FC0EF5CD46EB40DFA98AE89EA9BD18A5', 'Math', 'English', 'Solve real-world and mathematical problems by graphing points in all four quadrants of the coordinate plane. Include use of coordinates and absolute value to find distances between points with the same first coordinate or the same second coordinate.', 8, 'a:1:{i:0;s:2:"06";}', 'Common Core State Standards Initiative', 'CC', 'Grade 6', 'Math.6.NS.8', '6.NS.8', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434D8";s:2:"id";s:8:"S11434D8";s:6:"parent";s:8:"S11434C5";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"6.NS.8";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"FC0EF5CD46EB40DFA98AE89EA9BD18A5";s:11:"dotNotation";s:11:"Math.6.NS.8";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/6/NS/8";s:10:"currentURL";s:88:"http://www.corestandards.org/the-standards/mathematics/grade-6/the-number-system/#6-ns-8";}'),
