(342, 'F020570FB095480193A4F969241B8029', 'Math', 'English', 'Understand p + q as the number located a distance |q| from p, in the positive or negative direction depending on whether q is positive or negative. Show that a number and its opposite have a sum of 0 (are additive inverses). Interpret sums of rational numbers by describing real-world contexts.', 0, 'a:1:{i:0;s:2:"07";}', 'Common Core State Standards Initiative', 'CC', 'Grade 7', 'Math.7.NS.1b', '7.NS.1b', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143671";s:2:"id";s:8:"S1143671";s:6:"parent";s:8:"S1143511";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"7.NS.1.b";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"F020570FB095480193A4F969241B8029";s:11:"dotNotation";s:12:"Math.7.NS.1b";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/7/NS/1/b";s:10:"currentURL";N;}'),
