(365, '666AA11DF39241C68112FFBE28D811C4', 'Math', 'English', 'Use variables to represent numbers and write expressions when solving a real-world or mathematical problem; understand that a variable can represent an unknown number, or, depending on the purpose at hand, any number in a specified set.', 6, 'a:1:{i:0;s:2:"06";}', 'Common Core State Standards Initiative', 'CC', 'Grade 6', 'Math.6.EE.6', '6.EE.6', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434DE";s:2:"id";s:8:"S11434DE";s:6:"parent";s:8:"S11434C8";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"6.EE.6";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"666AA11DF39241C68112FFBE28D811C4";s:11:"dotNotation";s:11:"Math.6.EE.6";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/6/EE/6";s:10:"currentURL";s:96:"http://www.corestandards.org/the-standards/mathematics/grade-6/expressions-and-equations/#6-ee-6";}'),
