(367, 'AC4D37B9DF88460E98D9B2B8B014BD72', 'Math', 'English', 'Write an inequality of the form x &gt; c or x &lt; c to represent a constraint or condition in a real-world or mathematical problem. Recognize that inequalities of the form x &gt; c or x &lt; c have infinitely many solutions; represent solutions of such inequalities on number line diagrams.', 8, 'a:1:{i:0;s:2:"06";}', 'Common Core State Standards Initiative', 'CC', 'Grade 6', 'Math.6.EE.8', '6.EE.8', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434E0";s:2:"id";s:8:"S11434E0";s:6:"parent";s:8:"S11434C8";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"6.EE.8";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"AC4D37B9DF88460E98D9B2B8B014BD72";s:11:"dotNotation";s:11:"Math.6.EE.8";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/6/EE/8";s:10:"currentURL";s:96:"http://www.corestandards.org/the-standards/mathematics/grade-6/expressions-and-equations/#6-ee-8";}'),
(368, '7FCA1FBCCFE846C3A774502E1F65B093', 'Math', 'English', 'Represent and analyze quantitative relationships between dependent and independent variables.', 0, 'a:1:{i:0;s:2:"06";}', 'Common Core State Standards Initiative', 'CC', 'Grade 6', 'Math.6.EE.C', '6.EE.C', 'N;', 'a:4:{s:4:"GUID";s:32:"7FCA1FBCCFE846C3A774502E1F65B093";s:11:"dotNotation";s:11:"Math.6.EE.C";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/6/EE/C";s:10:"currentURL";N;}'),
(369, '3C3333C32A6E4223B2FAC1577642617E', 'Math', 'English', 'Use variables to represent two quantities in a real-world problem that change in relationship to one another; write an equation to express one quantity, thought of as the dependent variable, in terms of the other quantity, thought of as the independent variable. Analyze the relationship between the dependent and independent variables using graphs and tables, and relate these to the equation.', 9, 'a:1:{i:0;s:2:"06";}', 'Common Core State Standards Initiative', 'CC', 'Grade 6', 'Math.6.EE.9', '6.EE.9', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11434E1";s:2:"id";s:8:"S11434E1";s:6:"parent";s:8:"S11434C9";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"6.EE.9";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"3C3333C32A6E4223B2FAC1577642617E";s:11:"dotNotation";s:11:"Math.6.EE.9";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/6/EE/9";s:10:"currentURL";s:96:"http://www.corestandards.org/the-standards/mathematics/grade-6/expressions-and-equations/#6-ee-9";}'),
(370, 'B8B28A72AADF4D5C9D819A0AD29E830F', 'Math', 'English', 'Use properties of operations to generate equivalent expressions.', 0, 'a:1:{i:0;s:2:"07";}', 'Common Core State Standards Initiative', 'CC', 'Grade 7', 'Math.7.EE.A', '7.EE.A', 'N;', 'a:4:{s:4:"GUID";s:32:"B8B28A72AADF4D5C9D819A0AD29E830F";s:11:"dotNotation";s:11:"Math.7.EE.A";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/7/EE/A";s:10:"currentURL";N;}'),
(371, 'DDA127661AED435481B8FCD67A9CBB2B', 'Math', 'English', 'Apply properties of operations as strategies to add, subtract, factor, and expand linear expressions with rational coefficients.', 1, 'a:1:{i:0;s:2:"07";}', 'Common Core State Standards Initiative', 'CC', 'Grade 7', 'Math.7.EE.1', '7.EE.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143514";s:2:"id";s:8:"S1143514";s:6:"parent";s:8:"S1143507";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"7.EE.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"DDA127661AED435481B8FCD67A9CBB2B";s:11:"dotNotation";s:11:"Math.7.EE.1";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/7/EE/1";s:10:"currentURL";s:96:"http://www.corestandards.org/the-standards/mathematics/grade-7/expressions-and-equations/#7-ee-1";}'),
(372, '714C5DE265264B2694B0E864F32FE2AE', 'Math', 'English', 'Understand that rewriting an expression in different forms in a problem context can shed light on the problem and how the quantities in it are related.', 2, 'a:1:{i:0;s:2:"07";}', 'Common Core State Standards Initiative', 'CC', 'Grade 7', 'Math.7.EE.2', '7.EE.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143515";s:2:"id";s:8:"S1143515";s:6:"parent";s:8:"S1143507";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"7.EE.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"714C5DE265264B2694B0E864F32FE2AE";s:11:"dotNotation";s:11:"Math.7.EE.2";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/7/EE/2";s:10:"currentURL";s:96:"http://www.corestandards.org/the-standards/mathematics/grade-7/expressions-and-equations/#7-ee-2";}'),
(373, '28C6157CE6114983AE2E7334B88BB477', 'Math', 'English', 'Solve real-life and mathematical problems using numerical and algebraic expressions and equations.', 0, 'a:1:{i:0;s:2:"07";}', 'Common Core State Standards Initiative', 'CC', 'Grade 7', 'Math.7.EE.B', '7.EE.B', 'N;', 'a:4:{s:4:"GUID";s:32:"28C6157CE6114983AE2E7334B88BB477";s:11:"dotNotation";s:11:"Math.7.EE.B";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/7/EE/B";s:10:"currentURL";N;}'),
(374, 'BD7C2039AF6A41409D5B23B1D5A753F3', 'Math', 'English', 'Solve multi-step real-life and mathematical problems posed with positive and negative rational numbers in any form (whole numbers, fractions, and decimals), using tools strategically. Apply properties of operations to calculate with numbers in any form; convert between forms as appropriate; and assess the reasonableness of answers using mental computation and estimation strategies.', 3, 'a:1:{i:0;s:2:"07";}', 'Common Core State Standards Initiative', 'CC', 'Grade 7', 'Math.7.EE.3', '7.EE.3', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143516";s:2:"id";s:8:"S1143516";s:6:"parent";s:8:"S1143508";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"7.EE.3";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"BD7C2039AF6A41409D5B23B1D5A753F3";s:11:"dotNotation";s:11:"Math.7.EE.3";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/7/EE/3";s:10:"currentURL";s:96:"http://www.corestandards.org/the-standards/mathematics/grade-7/expressions-and-equations/#7-ee-3";}'),
(375, '5C4A177A795D42178DD81C960C176EAC', 'Math', 'English', 'Use variables to represent quantities in a real-world or mathematical problem, and construct simple equations and inequalities to solve problems by reasoning about the quantities.', 4, 'a:1:{i:0;s:2:"07";}', 'Common Core State Standards Initiative', 'CC', 'Grade 7', 'Math.7.EE.4', '7.EE.4', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143517";s:2:"id";s:8:"S1143517";s:6:"parent";s:8:"S1143508";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"7.EE.4";s:3:"cls";s:6:"folder";}', 'a:4:{s:4:"GUID";s:32:"5C4A177A795D42178DD81C960C176EAC";s:11:"dotNotation";s:11:"Math.7.EE.4";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/7/EE/4";s:10:"currentURL";s:96:"http://www.corestandards.org/the-standards/mathematics/grade-7/expressions-and-equations/#7-ee-4";}'),
(376, '2F1135F18E434B77BB694AC9D3EEE575', 'Math', 'English', 'Solve word problems leading to equations of the form px + q = r and p(x + q) = r, where p, q, and r are specific rational numbers. Solve equations of these forms fluently. Compare an algebraic solution to an arithmetic solution, identifying the sequence of the operations used in each approach.', 0, 'a:1:{i:0;s:2:"07";}', 'Common Core State Standards Initiative', 'CC', 'Grade 7', 'Math.7.EE.4a', '7.EE.4a', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143667";s:2:"id";s:8:"S1143667";s:6:"parent";s:8:"S1143517";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"7.EE.4.a";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"2F1135F18E434B77BB694AC9D3EEE575";s:11:"dotNotation";s:12:"Math.7.EE.4a";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/7/EE/4/a";s:10:"currentURL";N;}'),
(377, '38D1A0732B9A4055BA1E28B6D44D2493', 'Math', 'English', 'Solve word problems leading to inequalities of the form px + q &gt; r or px + q &lt; r, where p, q, and r are specific rational numbers. Graph the solution set of the inequality and interpret it in the context of the problem.', 0, 'a:1:{i:0;s:2:"07";}', 'Common Core State Standards Initiative', 'CC', 'Grade 7', 'Math.7.EE.4b', '7.EE.4b', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143668";s:2:"id";s:8:"S1143668";s:6:"parent";s:8:"S1143517";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"7.EE.4.b";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"38D1A0732B9A4055BA1E28B6D44D2493";s:11:"dotNotation";s:12:"Math.7.EE.4b";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/7/EE/4/b";s:10:"currentURL";N;}'),
(378, '42D43D973FEF4A028D2AEAC7151A01DB', 'Math', 'English', 'Work with radicals and integer exponents.', 0, 'a:1:{i:0;s:2:"08";}', 'Common Core State Standards Initiative', 'CC', 'Grade 8', 'Math.8.EE.A', '8.EE.A', 'N;', 'a:4:{s:4:"GUID";s:32:"42D43D973FEF4A028D2AEAC7151A01DB";s:11:"dotNotation";s:11:"Math.8.EE.A";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/8/EE/A";s:10:"currentURL";N;}'),
(379, '48506CB1948147B0890BD73B816C81D4', 'Math', 'English', 'Know and apply the properties of integer exponents to generate equivalent numerical expressions.', 1, 'a:1:{i:0;s:2:"08";}', 'Common Core State Standards Initiative', 'CC', 'Grade 8', 'Math.8.EE.1', '8.EE.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114352D";s:2:"id";s:8:"S114352D";s:6:"parent";s:8:"S114352A";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"8.EE.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"48506CB1948147B0890BD73B816C81D4";s:11:"dotNotation";s:11:"Math.8.EE.1";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/8/EE/1";s:10:"currentURL";s:96:"http://www.corestandards.org/the-standards/mathematics/grade-8/expressions-and-equations/#8-ee-1";}'),
(380, '5179CBDD896D4FD2973CDDAEC393C948', 'Math', 'English', 'Use square root and cube root symbols to represent solutions to equations of the form xÂ² = p and xÂ³ = p, where p is a positive rational number. Evaluate square roots of small perfect squares and cube roots of small perfect cubes. Know that âˆš2 is irrational.', 2, 'a:1:{i:0;s:2:"08";}', 'Common Core State Standards Initiative', 'CC', 'Grade 8', 'Math.8.EE.2', '8.EE.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114352E";s:2:"id";s:8:"S114352E";s:6:"parent";s:8:"S114352A";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"8.EE.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"5179CBDD896D4FD2973CDDAEC393C948";s:11:"dotNotation";s:11:"Math.8.EE.2";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/8/EE/2";s:10:"currentURL";s:96:"http://www.corestandards.org/the-standards/mathematics/grade-8/expressions-and-equations/#8-ee-2";}'),
(381, '0FC0B4EB2CD94EEA97757C7E474A4609', 'Math', 'English', 'Use numbers expressed in the form of a single digit times an integer power of 10 to estimate very large or very small quantities, and to express how many times as much one is than the other.', 3, 'a:1:{i:0;s:2:"08";}', 'Common Core State Standards Initiative', 'CC', 'Grade 8', 'Math.8.EE.3', '8.EE.3', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114352F";s:2:"id";s:8:"S114352F";s:6:"parent";s:8:"S114352A";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"8.EE.3";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"0FC0B4EB2CD94EEA97757C7E474A4609";s:11:"dotNotation";s:11:"Math.8.EE.3";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/8/EE/3";s:10:"currentURL";s:96:"http://www.corestandards.org/the-standards/mathematics/grade-8/expressions-and-equations/#8-ee-3";}'),
(382, 'E625C65889F547ED92819D3B9F7C4216', 'Math', 'English', 'Perform operations with numbers expressed in scientific notation, including problems where both decimal and scientific notation are used. Use scientific notation and choose units of appropriate size for measurements of very large or very small quantities (e.g., use millimeters per year for seafloor spreading). Interpret scientific notation that has been generated by technology.', 4, 'a:1:{i:0;s:2:"08";}', 'Common Core State Standards Initiative', 'CC', 'Grade 8', 'Math.8.EE.4', '8.EE.4', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143530";s:2:"id";s:8:"S1143530";s:6:"parent";s:8:"S114352A";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"8.EE.4";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"E625C65889F547ED92819D3B9F7C4216";s:11:"dotNotation";s:11:"Math.8.EE.4";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/8/EE/4";s:10:"currentURL";s:96:"http://www.corestandards.org/the-standards/mathematics/grade-8/expressions-and-equations/#8-ee-4";}'),
(383, 'D41D63A930114002AC63910B8A561DBD', 'Math', 'English', 'Understand the connections between proportional relationships, lines, and linear equations.', 0, 'a:1:{i:0;s:2:"08";}', 'Common Core State Standards Initiative', 'CC', 'Grade 8', 'Math.8.EE.B', '8.EE.B', 'N;', 'a:4:{s:4:"GUID";s:32:"D41D63A930114002AC63910B8A561DBD";s:11:"dotNotation";s:11:"Math.8.EE.B";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/8/EE/B";s:10:"currentURL";N;}'),
(384, 'E2FCE06C6D0649DAB51E7FAB19A6BB8B', 'Math', 'English', 'Graph proportional relationships, interpreting the unit rate as the slope of the graph. Compare two different proportional relationships represented in different ways.', 5, 'a:1:{i:0;s:2:"08";}', 'Common Core State Standards Initiative', 'CC', 'Grade 8', 'Math.8.EE.5', '8.EE.5', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143531";s:2:"id";s:8:"S1143531";s:6:"parent";s:8:"S114352B";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"8.EE.5";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"E2FCE06C6D0649DAB51E7FAB19A6BB8B";s:11:"dotNotation";s:11:"Math.8.EE.5";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/8/EE/5";s:10:"currentURL";s:96:"http://www.corestandards.org/the-standards/mathematics/grade-8/expressions-and-equations/#8-ee-5";}'),
(385, '607B0D02788646F4895FE734C9EE481A', 'Math', 'English', 'Use similar triangles to explain why the slope m is the same between any two distinct points on a non-vertical line in the coordinate plane; derive the equation y = mx for a line through the origin and the equation y = mx + b for a line intercepting the vertical axis at b.', 6, 'a:1:{i:0;s:2:"08";}', 'Common Core State Standards Initiative', 'CC', 'Grade 8', 'Math.8.EE.6', '8.EE.6', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143532";s:2:"id";s:8:"S1143532";s:6:"parent";s:8:"S114352B";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"8.EE.6";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"607B0D02788646F4895FE734C9EE481A";s:11:"dotNotation";s:11:"Math.8.EE.6";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/8/EE/6";s:10:"currentURL";s:96:"http://www.corestandards.org/the-standards/mathematics/grade-8/expressions-and-equations/#8-ee-6";}'),
(386, '29419E561D0F4947929F5400799CB6ED', 'Math', 'English', 'Analyze and solve linear equations and pairs of simultaneous linear equations.', 0, 'a:1:{i:0;s:2:"08";}', 'Common Core State Standards Initiative', 'CC', 'Grade 8', 'Math.8.EE.C', '8.EE.C', 'N;', 'a:4:{s:4:"GUID";s:32:"29419E561D0F4947929F5400799CB6ED";s:11:"dotNotation";s:11:"Math.8.EE.C";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/8/EE/C";s:10:"currentURL";N;}'),
(387, '7276B02F0B004E889E6355C98B8C1F62', 'Math', 'English', 'Solve linear equations in one variable.', 7, 'a:1:{i:0;s:2:"08";}', 'Common Core State Standards Initiative', 'CC', 'Grade 8', 'Math.8.EE.7', '8.EE.7', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143533";s:2:"id";s:8:"S1143533";s:6:"parent";s:8:"S114352C";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"8.EE.7";s:3:"cls";s:6:"folder";}', 'a:4:{s:4:"GUID";s:32:"7276B02F0B004E889E6355C98B8C1F62";s:11:"dotNotation";s:11:"Math.8.EE.7";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/8/EE/7";s:10:"currentURL";s:96:"http://www.corestandards.org/the-standards/mathematics/grade-8/expressions-and-equations/#8-ee-7";}'),
(388, '37D0AF8DE45246A1BE82DA6ACB8DC0D4', 'Math', 'English', 'Give examples of linear equations in one variable with one solution, infinitely many solutions, or no solutions. Show which of these possibilities is the case by successively transforming the given equation into simpler forms, until an equivalent equation of the form x = a, a = a, or a = b results (where a and b are different numbers).', 0, 'a:1:{i:0;s:2:"08";}', 'Common Core State Standards Initiative', 'CC', 'Grade 8', 'Math.8.EE.7a', '8.EE.7a', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143662";s:2:"id";s:8:"S1143662";s:6:"parent";s:8:"S1143533";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"8.EE.7.a";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"37D0AF8DE45246A1BE82DA6ACB8DC0D4";s:11:"dotNotation";s:12:"Math.8.EE.7a";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/8/EE/7/a";s:10:"currentURL";N;}');
