(404, '00314B63F7C044B48D1E6021D30FA77A', 'Math', 'English', 'Giving quantitative measures of center (median and/or mean) and variability (interquartile range and/or mean absolute deviation), as well as describing any overall pattern and any striking deviations from the overall pattern with reference to the context in which the data were gathered.', 0, 'a:1:{i:0;s:2:"06";}', 'Common Core State Standards Initiative', 'CC', 'Grade 6', 'Math.6.SP.5c', '6.SP.5c', 'a:6:{s:2:"id";N;s:6:"parent";s:8:"S11434EA";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"6.SP.5.c";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"00314B63F7C044B48D1E6021D30FA77A";s:11:"dotNotation";s:12:"Math.6.SP.5c";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/6/SP/5/c";s:10:"currentURL";N;}'),
