(410, 'EC52E8776E5F4A498AE2DEE64FFB60DD', 'Math', 'English', 'Informally assess the degree of visual overlap of two numerical data distributions with similar variabilities, measuring the difference between the centers by expressing it as a multiple of a measure of variability.', 3, 'a:1:{i:0;s:2:"07";}', 'Common Core State Standards Initiative', 'CC', 'Grade 7', 'Math.7.SP.3', '7.SP.3', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143520";s:2:"id";s:8:"S1143520";s:6:"parent";s:8:"S114350C";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"7.SP.3";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"EC52E8776E5F4A498AE2DEE64FFB60DD";s:11:"dotNotation";s:11:"Math.7.SP.3";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/7/SP/3";s:10:"currentURL";s:97:"http://www.corestandards.org/the-standards/mathematics/grade-7/statistics-and-probability/#7-sp-3";}'),
(411, '067475BBB3A04DC88E24731D6D606C1F', 'Math', 'English', 'Use measures of center and measures of variability for numerical data from random samples to draw informal comparative inferences about two populations.', 4, 'a:1:{i:0;s:2:"07";}', 'Common Core State Standards Initiative', 'CC', 'Grade 7', 'Math.7.SP.4', '7.SP.4', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143521";s:2:"id";s:8:"S1143521";s:6:"parent";s:8:"S114350C";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"7.SP.4";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"067475BBB3A04DC88E24731D6D606C1F";s:11:"dotNotation";s:11:"Math.7.SP.4";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/7/SP/4";s:10:"currentURL";s:97:"http://www.corestandards.org/the-standards/mathematics/grade-7/statistics-and-probability/#7-sp-4";}'),
