(419, 'F9897607C3E8445E8391D0F7284D37E0', 'Math', 'English', 'Understand that, just as with simple events, the probability of a compound event is the fraction of outcomes in the sample space for which the compound event occurs.', 0, 'a:1:{i:0;s:2:"07";}', 'Common Core State Standards Initiative', 'CC', 'Grade 7', 'Math.7.SP.8a', '7.SP.8a', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114365F";s:2:"id";s:8:"S114365F";s:6:"parent";s:8:"S1143525";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"7.SP.8.a";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"F9897607C3E8445E8391D0F7284D37E0";s:11:"dotNotation";s:12:"Math.7.SP.8a";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/7/SP/8/a";s:10:"currentURL";N;}'),
(420, '0ED4E865656449238229475118C793D4', 'Math', 'English', 'Represent sample spaces for compound events using methods such as organized lists, tables and tree diagrams. For an event described in everyday language (e.g., &quot;rolling double sixes&quot;), identify the outcomes in the sample space which compose the event. ', 0, 'a:1:{i:0;s:2:"07";}', 'Common Core State Standards Initiative', 'CC', 'Grade 7', 'Math.7.SP.8b', '7.SP.8b', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143660";s:2:"id";s:8:"S1143660";s:6:"parent";s:8:"S1143525";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:8:"7.SP.8.b";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"0ED4E865656449238229475118C793D4";s:11:"dotNotation";s:12:"Math.7.SP.8b";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/7/SP/8/b";s:10:"currentURL";N;}'),
