(424, '98EE36EE4E014C1E898F6619327BAD16', 'Math', 'English', 'Know that straight lines are widely used to model relationships between two quantitative variables. For scatter plots that suggest a linear association, informally fit a straight line, and informally assess the model fit by judging the closeness of the data points to the line.', 2, 'a:1:{i:0;s:2:"08";}', 'Common Core State Standards Initiative', 'CC', 'Grade 8', 'Math.8.SP.2', '8.SP.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114354A";s:2:"id";s:8:"S114354A";s:6:"parent";s:8:"S1143548";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"8.SP.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"98EE36EE4E014C1E898F6619327BAD16";s:11:"dotNotation";s:11:"Math.8.SP.2";s:3:"URI";s:49:"http://corestandards.org/2010/math/content/8/SP/2";s:10:"currentURL";s:97:"http://www.corestandards.org/the-standards/mathematics/grade-8/statistics-and-probability/#8-sp-2";}'),
