(429, 'BB5EA8046C4C4207A113105C9AF885F6', 'Math', 'English', 'Understand that a function is a rule that assigns to each input exactly one output. The graph of a function is the set of ordered pairs consisting of an input and the corresponding output.', 1, 'a:1:{i:0;s:2:"08";}', 'Common Core State Standards Initiative', 'CC', 'Grade 8', 'Math.8.F.1', '8.F.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S1143537";s:2:"id";s:8:"S1143537";s:6:"parent";s:8:"S1143535";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"8.F.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"BB5EA8046C4C4207A113105C9AF885F6";s:11:"dotNotation";s:10:"Math.8.F.1";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/8/F/1";s:10:"currentURL";s:79:"http://www.corestandards.org/the-standards/mathematics/grade-8/functions/#8-F-1";}'),
