(433, 'BF97FDF74A5241C0BF522A56F7F3F502', 'Math', 'English', 'Construct a function to model a linear relationship between two quantities. Determine the rate of change and initial value of the function from a description of a relationship or from two (x, y) values, including reading these from a table or from a graph. Interpret the rate of change and initial value of a linear function in terms of the situation it models, and in terms of its graph or a table of values.', 4, 'a:1:{i:0;s:2:"08";}', 'Common Core State Standards Initiative', 'CC', 'Grade 8', 'Math.8.F.4', '8.F.4', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S114353A";s:2:"id";s:8:"S114353A";s:6:"parent";s:8:"S1143536";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:5:"8.F.4";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"BF97FDF74A5241C0BF522A56F7F3F502";s:11:"dotNotation";s:10:"Math.8.F.4";s:3:"URI";s:48:"http://corestandards.org/2010/math/content/8/F/4";s:10:"currentURL";s:79:"http://www.corestandards.org/the-standards/mathematics/grade-8/functions/#8-F-4";}'),
