(533, '024460620E624fb2BADC665C38AC3981', 'Math', 'English', 'Understand that a function from one set (called the domain) to another set (called the range) assigns to each element of the domain exactly one element of the range. If f is a function and x is an element of its domain, then f(x) denotes the output of f corresponding to the input x. The graph of f is the graph of the equation y = f(x).', 1, 'a:4:{i:0;s:2:"09";i:1;s:2:"10";i:2;s:2:"11";i:3;s:2:"12";}', 'Common Core State Standards Initiative', 'CC', 'High Schoo', 'Math.HSF-IF.1', 'F-IF.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11435E9";s:2:"id";s:8:"S11435E9";s:6:"parent";s:8:"S1143581";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"F-IF.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"024460620E624fb2BADC665C38AC3981";s:11:"dotNotation";s:13:"Math.HSF-IF.1";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/HSF/IF/1";s:10:"currentURL";s:107:"http://www.corestandards.org/the-standards/mathematics/high-school-functions/interpreting-functions/#f-if-1";}'),
