(593, 'C705AD3CCF9641C9A3101BDB10737B12', 'Math', 'English', 'Know precise definitions of angle, circle, perpendicular line, parallel line, and line segment, based on the undefined notions of point, line, distance along a line, and distance around a circular arc.', 1, 'a:4:{i:0;s:2:"09";i:1;s:2:"10";i:2;s:2:"11";i:3;s:2:"12";}', 'Common Core State Standards Initiative', 'CC', 'High Schoo', 'Math.HSG-CO.1', 'G-CO.1', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11435BE";s:2:"id";s:8:"S11435BE";s:6:"parent";s:8:"S1143572";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"G-CO.1";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"C705AD3CCF9641C9A3101BDB10737B12";s:11:"dotNotation";s:13:"Math.HSG-CO.1";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/HSG/CO/1";s:10:"currentURL";s:94:"http://www.corestandards.org/the-standards/mathematics/high-school-geometry/congruence/#g-co-1";}'),
(594, 'DD05C3FD51B54767BE49C8566053DD30', 'Math', 'English', 'Represent transformations in the plane using, e.g., transparencies and geometry software; describe transformations as functions that take points in the plane as inputs and give other points as outputs. Compare transformations that preserve distance and angle to those that do not (e.g., translation versus horizontal stretch).', 2, 'a:4:{i:0;s:2:"09";i:1;s:2:"10";i:2;s:2:"11";i:3;s:2:"12";}', 'Common Core State Standards Initiative', 'CC', 'High Schoo', 'Math.HSG-CO.2', 'G-CO.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11435BF";s:2:"id";s:8:"S11435BF";s:6:"parent";s:8:"S1143572";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"G-CO.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"DD05C3FD51B54767BE49C8566053DD30";s:11:"dotNotation";s:13:"Math.HSG-CO.2";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/HSG/CO/2";s:10:"currentURL";s:94:"http://www.corestandards.org/the-standards/mathematics/high-school-geometry/congruence/#g-co-2";}'),
(595, 'C9B1E6F9029B46BF91FA3D7AD3424D81', 'Math', 'English', 'Given a rectangle, parallelogram, trapezoid, or regular polygon, describe the rotations and reflections that carry it onto itself.', 3, 'a:4:{i:0;s:2:"09";i:1;s:2:"10";i:2;s:2:"11";i:3;s:2:"12";}', 'Common Core State Standards Initiative', 'CC', 'High Schoo', 'Math.HSG-CO.3', 'G-CO.3', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11435C0";s:2:"id";s:8:"S11435C0";s:6:"parent";s:8:"S1143572";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"G-CO.3";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"C9B1E6F9029B46BF91FA3D7AD3424D81";s:11:"dotNotation";s:13:"Math.HSG-CO.3";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/HSG/CO/3";s:10:"currentURL";s:94:"http://www.corestandards.org/the-standards/mathematics/high-school-geometry/congruence/#g-co-3";}'),
