(685, 'C67462424FF44231B0500E71BC10F76D', 'Math', 'English', 'Understand that two events A and B are independent if the probability of A and B occurring together is the product of their probabilities, and use this characterization to determine if they are independent.', 2, 'a:4:{i:0;s:2:"09";i:1;s:2:"10";i:2;s:2:"11";i:3;s:2:"12";}', 'Common Core State Standards Initiative', 'CC', 'High Schoo', 'Math.HSS-CP.2', 'S-CP.2', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11435AF";s:2:"id";s:8:"S11435AF";s:6:"parent";s:8:"S114356E";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"S-CP.2";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"C67462424FF44231B0500E71BC10F76D";s:11:"dotNotation";s:13:"Math.HSS-CP.2";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/HSS/CP/2";s:10:"currentURL";s:145:"http://www.corestandards.org/the-standards/mathematics/hs-statistics-and-probability/conditional-probability-and-the-rules-of-probability/#s-cp-2";}'),
(686, 'A06F80A4479C4ED091D5D027DDD5FDE1', 'Math', 'English', 'Understand the conditional probability of A given B as P(A and B)/P(B), and interpret independence of A and B as saying that the conditional probability of A given B is the same as the probability of A, and the conditional probability of B given A is the same as the probability of B.', 3, 'a:4:{i:0;s:2:"09";i:1;s:2:"10";i:2;s:2:"11";i:3;s:2:"12";}', 'Common Core State Standards Initiative', 'CC', 'High Schoo', 'Math.HSS-CP.3', 'S-CP.3', 'a:7:{s:10:"identifier";s:38:"http://purl.org/ASN/resources/S11435B0";s:2:"id";s:8:"S11435B0";s:6:"parent";s:8:"S114356E";s:14:"indexingStatus";s:3:"Yes";s:15:"authorityStatus";s:18:"Original Statement";s:17:"statementNotation";s:6:"S-CP.3";s:4:"leaf";s:4:"true";}', 'a:4:{s:4:"GUID";s:32:"A06F80A4479C4ED091D5D027DDD5FDE1";s:11:"dotNotation";s:13:"Math.HSS-CP.3";s:3:"URI";s:51:"http://corestandards.org/2010/math/content/HSS/CP/3";s:10:"currentURL";s:145:"http://www.corestandards.org/the-standards/mathematics/hs-statistics-and-probability/conditional-probability-and-the-rules-of-probability/#s-cp-3";}'),
